  false,\n\t\"url\": null,\n\t\"notes\": \"NYC Wi-Fi Hotspot LocationsrnrnWi-Fi Providers:rnCityBridge,
  LLC (Free Beta): LinkNYC 1 gigabyte (GB), Free Wi-Fi Internet KiosksrnAT&T (Free):
  Wi-Fi access is free for all users at all times.rnPartners: In several parks, the
  NYC partner organizations provide publicly accessible Wi-Fi. Visit these parks to
  learn more information about their Wi-Fi service and how to connect.rnCable (Limited-Free):
  In NYC Parks provided by NYC DoITT Cable television franchisees.rnCablevision and
  Time Warner Cable (Limited Free) Connect for 3 free 10 minute sessions every 30
  days or purchase a 99 cent day pass through midnight. Wi-Fi service is free at all
  times to Cablevisionu2019s Optimum Online and Time Warner Cable broadband subscribers.rnWi-Fi
  Provider: Chelsea Wi-Fi (Free) Wi-Fi access is free for all users at all times.rnChelsea
  Improvement Company has partnered with Google to provide Wi-Fi a free wireless Internet
  zone, a broadband region bounded by West 19th Street, Gansevoort Street, Eighth
  Avenue and the High Line Park.rnWi-Fi Provider: Downtown Brooklyn Wi-Fi (Free)rnThe
  Downtown Brooklyn Partnership - the New York City Economic Development Corporation
  to provide Wi-Fi to the area bordered by Schermerhorn Street, Cadman Plaza West,
  Flatbush Avenue, and Tillary Street, along with select public spaces in the NYCHA
  Ingersoll and Whitman Houses.rnWi-Fi Provider: Manhattan Downtown Alliance Wi-Fi
  (Free)rnLower Manhattan Several public spaces all along Water Street, Front Street
  and the East River Esplanade south of Fulton Street and in several other locations
  throughout Lower Manhattan.rnWi-Fi Provider: Harlem Wi-Fi (Free)rnNetwork will extend
  95 city blocks, from 110th to 138th Streets between Frederick Douglass Boulevard
  and Madison Avenue is free outdoor public wireless network.rnWi-Fi Provider: Transit
  Wireless (Free)rnWi-Fi Services in the New York City subway system are available
  in certain underground stations. For more information visit http://www.transitwireless.com/stations/.rnWi-Fi
  Provider: Public Pay Telephone Franchisees (Free)rnUsing existing payphone infrastructure,
  the City of New York has teamed up with private partners to provide free Wi-Fi service
  at public payphone kiosks across the five boroughs at no cost to taxpayers.rnWi-Fi
  Provider: New York Public LibraryrnUsing Wireless Internet Access (Wi-Fi): All Library
  locations offer free wireless access (Wi-Fi) in public areas at all times the libraries
  are open.rnConnecting to the Library's Wireless Network rnu2022You must have a computer
  or other device equipped with an 802.11b-compatible wireless card. rnu2022Using
  your computer's network utilities, look for the wireless network named \"NYPL.\"
  rnu2022The \"NYPL\" wireless network does not require a password to connect.rnLimitations
  and Disclaimers Regarding Wireless Access rnu2022The Library's wireless network
  is not secure. Information sent from or to your laptop can be captured by anyone
  else with a wireless device and the appropriate software, within three hundred feet.
  rnu2022Library staff is not able to provide technical assistance and no guarantee
  can be provided that you will be able to make a wireless connection. rnu2022The
  Library assumes no responsibility for the safety of equipment or for laptop configurations,
  security, or data files resulting from connection to the Library's network.\",\n\t\"license_title\":
